import React from 'react';
import styled from 'styled-components';

const CheckoutWrapper = styled.div`
  margin-top: 120px;
  padding: 3rem 0;
  min-height: 60vh;
`;

const CheckoutTitle = styled.h1`
  font-size: 2.5rem;
  font-weight: 700;
  color: var(--primary-black);
  margin-bottom: 2rem;
  text-align: center;
`;

const ComingSoon = styled.div`
  text-align: center;
  padding: 4rem 2rem;

  i {
    font-size: 5rem;
    color: var(--primary-pink);
    margin-bottom: 1rem;
  }

  h2 {
    font-size: 2rem;
    font-weight: 700;
    color: var(--primary-black);
    margin-bottom: 1rem;
  }

  p {
    font-size: 1.1rem;
    color: var(--gray);
  }
`;

const Checkout = () => {
  return (
    <CheckoutWrapper>
      <div className="container">
        <CheckoutTitle>Checkout</CheckoutTitle>
        <ComingSoon>
          <i className="fas fa-credit-card"></i>
          <h2>Checkout Coming Soon</h2>
          <p>We're working on a secure checkout experience for you</p>
        </ComingSoon>
      </div>
    </CheckoutWrapper>
  );
};

export default Checkout;
